import React, { useState } from 'react';
import './App.css';
import Clock from './Clock';
import jsonData from './testinfo.json';
import SingleButtons from './SingleButtons';
import WhatsNext from './WhatsNext';

const App = () => {
  const [userAnswers, setUserAnswers] = useState([]);

  return (
    <div className="app">
      <h1>Test</h1>
      <Clock />
      <div className="question-container">
        {jsonData.map((questionData, index) => {

          if (questionData.type === 'single') {
            return (
              <div key={index}>
                <h1>Type: {questionData.type}</h1>
                <h1>Question: {questionData.question}</h1>
                <SingleButtons options={questionData.options} answer={questionData.answers} />
              </div>
            );
          } 

          if (questionData.type === 'whatsNext') {
            return (
              <div key={index}>
                <h1>Type: {questionData.type}</h1>
                <h1>Question: {questionData.question}</h1>
                <WhatsNext options={questionData.options} answer={questionData.answers} />
              </div>
            );
          } 

        })}
      </div>
      <button className="submit-button"><strong>Submit</strong></button>
    </div>
  );
};

export default App;
